                    if(xhr.status && xhr.statusText != 'abort') {
                        showMessagePopup('Error', 'Error: ' + errorMsg);
                        paramObj.gridContainer.data('contrailGrid').showGridMessage('Error','Error: ' + errorMsg);
                    }
